                        "description": "Landing page | multisite | SaaS | web app | web portal | e-commerce | marketplace | other\n\nHey everyone! \nMy name is Artem, and I'm excited to tell you that I've made my love of UX/UI design and web development a career. I have been immersing myself in the newest front-end frameworks, WordPress plugins, and design trends in an unrelenting effort to hone my skills. To keep my work at the forefront of contemporary trends, I'm dedicated to learning new techniques and staying ahead of design advances.\n\n🙌🏼You Are My Client If you:\n- Value thoughtful, user-centric design\n- Looking for expertise in the latest web technologies, including WordPress, HTML, CSS, JavaScript, PHP\n- Require effective project management\n- Need Webflow skills\n- Want full-service design\n- Value close collaboration\n- Prioritize quality\n\n💥Tools I work with:\n- Figma - my primary tool for UX/UI design\n- Illustrator/Photoshop/Adobe XD - for all things graphics, from creating UI kits to detailed visual elements\n- Webflow - a key tool in my arsenal for the creation of responsive-designed websites\n- Principle - for motion design\n- Sublime Text or VSC - as the development environment\n- Git/WordPress   - for complex developing\n\n*Specializing in WooCommerce, Elementor, and other essential plugins for creating dynamic websites.\n*Fluent in HTML, CSS, JavaScript, and PHP, with a particular focus on WordPress environments.\n\n🌍 English Proficiency\nAs a fluent English speaker, I ensure seamless communication throughout our collaboration. This proficiency enables me to effectively understand your needs, articulate design concepts, and ensure that every aspect of your project aligns with your vision, regardless of where you are in the world\n\n🔥Results of Our Collaboration\nI provide a solution that helps your brand stand out, not just a design. Because I'm committed to doing my best, the product we develop together will be well-thought-out and appealing to your target audience, increasing engagement and brand awareness. Expect innovation, functionality, and clever design that exceeds your expectations.\n\nPlease use these Keywords to find me:\nUser Interface, User Experience, Design, Designer, UI, UX, Web-design, Webflow, Mobile Design, Mock-up, Design Expert, App Design, Application design, platform design, Adobe, Photoshop, Illustrator, Graphics, Graphic Design, Visual Design, Creative, Material Design, Guidelines, Android, iOS, Desktop, iPhone, Application, Usability, Website, Logo, Logotype, Responsive, Adaptive, Website Prototyping, Wireframe, Update, Solutions, Long term, Effective, Productive, Experienced, Job, SAAS, Hire, Testing, Advertising, Branding, Agency, Identity, Identity, Design Thinking, Management, Art Director, Head of Design, Search, Digital, Landing, Promo, Redesign, Developing, Creation, Page, Corporate, IT, Tech, Technology.",
                        "city": "Kyiv",
                        "country": "Ukraine",
                        "timezone": "UTC+03:00 Israel",
                        "cv": "Hi! My name is Artem, nice to meet you.\n\nWe could make a GREAT website together, what do you think about our potential cooperation? 🙂\nMy Behance can make an impression on you - https://www.behance.net/artemudovenko\n\nI'm extremely glad to showcase to you some of my previously delivered websites, I hope that you will adore them as much as my clients do:\n\n> https://www.figma.com/proto/lHsHV9ooRseZwHp1Tk0ZL9/QLEAN.?type=design&node-id=279-11960&t=FC1M0llUXsJYx8G3-1&scaling=min-zoom&page-id=174%3A79&mode=design\n> https://www.figma.com/proto/TwU0LAudyvonHjodNv6qw4/Flops.?page-id=0%3A1&node-id=2-6801&viewport=-1664%2C1476%2C0.15&scaling=min-zoom\n> https://www.figma.com/proto/taDMV3DB4uvC8bodsr0guU/Pitch-Guide?type=design&node-id=1-37&t=iZs5KzzlBaqusdlT-1&scaling=min-zoom&page-id=0%3A1&mode=design\n> https://www.figma.com/proto/ye5CbR5wFjKmJBr1ZZ3JSH/Intelistyle.?type=design&node-id=25-66&t=xzf3DCSu1RkSOKtQ-1&scaling=scale-down-width&page-id=0%3A1&mode=design\n\nWe can use the content you already have to make a website that looks good, gives useful information, and builds trust. Also, please feel free to send more references or style guides if you have any. My availability is 35-40 hrs / week and my rate is $30/hr. Looking forward to hearing from you and discussing other things too!\n\nSincerely,\nArtem",
